ulates a set of match criteria and an","                    action.  Both selector-based security Policy and security Profiles","                    reference rules - separated out as a list of rules for both ingress","                    and egress packet matching. \\n Each positive match criteria has","                    a negated version, prefixed with \\\"Not\\\". All the match criteria","                    within a rule must be satisfied for a packet to match. A single","                    rule can contain the positive and negative version of a match","                    and both must be satisfied for the rule to match.\"","                  properties:","                    action:","                      type: string","                    destination:","                      description: Destination contains the match criteria that apply","                        to destination entity.","                      properties:","                        namespaceSelector:","                          description: \"NamespaceSelector is an optional field that","                            contains a selector expression. Only traffic that originates","                            from (or terminates at) endpoints within the selected","                            namespaces will be matched. When both NamespaceSelector","                            and another selector are defined on the same rule, then","                            only workload endpoints that are matched by both selectors","                            will be selected by the rule. \\n For NetworkPolicy, an","                            empty NamespaceSelector implies that the Selector is limited","                            to selecting only workload endpoints in the same namespace","                            as the NetworkPolicy. \\n For NetworkPolicy, `global()`","                            NamespaceSelector implies that the Selector is limited","                            to selecting only GlobalNetworkSet or HostEndpoint. \\n","                            For GlobalNetworkPolicy, an empty NamespaceSelector implies","                            the Selector applies to workload endpoints across all","                            namespaces.\"","                          type: string","                        nets:","                          description: Nets is an optional field that restricts the","                            rule to only apply to traffic that originates from (or","                            terminates at) IP addresses in any of the given subnets.","                          items:","                            type: string","                          type: array","                        notNets:","                          description: NotNets is the negated version of the Nets","                            field.","                          items:","                            type: string","                          type: array","                        notPorts:","                          description: NotPorts is the negated version of the Ports","                            field. Since only some protocols have ports, if any ports","                            are specified it requires the Protocol match in the Rule","                            to be set to \"TCP\" or \"UDP\".","                          items:","                            anyOf:","                            - type: integer","                            - type: string","                            pattern: ^.*","                            x-kubernetes-int-or-string: true","                          type: array","                        notSelector:","                          description: NotSelector is the negated version of the Selector","                            field.  See Selector field for subtleties with negated","                            selectors.","                          type: string","                        ports:","                          description: \"Ports is an optional field that restricts","                            the rule to only apply to traffic that has a source (destination)","                            port that matches one of these ranges/values. This value","                            is a list of integers or strings that represent ranges","                            of ports. \\n Since only some protocols have ports, if","                            any ports are specified it requires the Protocol match","                            in the Rule to be set to \\\"TCP\\\" or \\\"UDP\\\".\"","                          items:","                            anyOf:","                            - type: integer","                            - type: string","                            pattern: ^.*","                            x-kubernetes-int-or-string: true","                          type: array","                        selector:","                          description: \"Selector is an optional field that contains","                            a selector expression (see Policy for sample syntax).","                            \\ Only traffic that originates from (terminates at) endpoints","                            matching the selector will be matched. \\n Note that: in","                            addition to the negated version of the Selector (see NotSelector","                            below), the selector expression syntax itself supports","                            negation.  The two types of negation are subtly different.","                            One negates the set of matched endpoints, the other negates","                            the whole match: \\n \\tSelector = \\\"!has(my_label)\\\" matches","                            packets that are from other Calico-controlled \\tendpoints","                            that do not have the label \\\"my_label\\\". \\n \\tNotSelector","                            = \\\"has(my_label)\\\" matches packets that are not from","                            Calico-controlled \\tendpoints that do have the label \\\"my_label\\\".","                            \\n The effect is that the latter will accept packets from","                            non-Calico sources whereas the former is limited to packets","                            from Calico-controlled endpoints.\"","                          type: string","                        serviceAccounts:","                          description: ServiceAccounts is an optional field that restricts","                            the rule to only apply to traffic that originates from","                            (or terminates at) a pod running as a matching service","                            account.","                          properties:","                            names:","                              description: Names is an optional field that restricts","                                the rule to only apply to traffic that originates","                                from (or terminates at) a pod running as a service","                                account whose name is in the list.","                              items:","                                type: string","                              type: array","                            selector:","                              description: Selector is an optional field that restricts","                                the rule to only apply to traffic that originates","                                from (or terminates at) a pod running as a service","                                account that matches the given label selector. If","                                both Names and Selector are specified then they are","                                AND'ed.","                              type: string","                          type: object","                        services:","                          description: \"Services is an optional field that contains","     