aths is an optional field that restricts","                            the rule to apply to HTTP requests that use one of the","                            listed HTTP Paths. Multiple paths are OR''d together.","                            e.g: - exact: /foo - prefix: /bar NOTE: Each entry may","                            ONLY specify either a `exact` or a `prefix` match. The","                            validator will check for it.'","                          items:","                            description: 'HTTPPath specifies an HTTP path to match.","                              It may be either of the form: exact: \u003cpath\u003e: which matches","                              the path exactly or prefix: \u003cpath-prefix\u003e: which matches","                              the path prefix'","                            properties:","                              exact:","                                type: string","                              prefix:","                                type: string","                            type: object","                          type: array","                      type: object","                    icmp:","                      description: ICMP is an optional field that restricts the rule","                        to apply to a specific type and code of ICMP traffic.  This","                        should only be specified if the Protocol field is set to \"ICMP\"","                        or \"ICMPv6\".","                      properties:","                        code:","                          description: Match on a specific ICMP code.  If specified,","                            the Type value must also be specified. This is a technical","                            limitation imposed by the kernel's iptables firewall,","                            which Calico uses to enforce the rule.","                          type: integer","                        type:","                          description: Match on 