r use in match","                  \\tcriteria.)\"","                items:","                  type: string","                type: array","              interfaceName:","                description: \"Either \\\"*\\\", or the name of a specific Linux interface","                  to apply policy to; or empty.  \\\"*\\\" indicates that this HostEndpoint","                  governs all traffic to, from or through the default network namespace","                  of the host named by the \\\"Node\\\" field; entering and leaving that","                  namespace via any interface, including those from/to non-host-networked","                  local workloads. \\n If InterfaceName is not \\\"*\\\", this HostEndpoint","                  only governs traffic that enters or leaves the host through the","                  specific interface named by InterfaceName, or - when InterfaceName","                  is empty - through the specific interface that has one of the IPs","                  in ExpectedIPs. Therefore, when InterfaceName is empty, at least","                  one expected IP must be specified.  Only external interfaces (such","                  as \\\"eth0\\\") are supported here; it isn't possible for a HostEndpoint","                  to protect traffic through a specific local workload interface.","                  \\n Note: Only some kinds of policy are implemented for \\\"*\\\" HostEndpoints;","                  initially just pre-DNAT policy.  Please check Calico documentation","                  for the latest position.\"","                type: string","              node:","                description: The node name identifying the Calico node instance.","                type: string","              ports:","                description: Ports contains the endpoint's named ports, which may","                  be referenced in security policy rules.","                items:","                  properties:","                    name:","             