                                 format: int32","                                      type: integer","                                    nodeAffinityPolicy:","                                      description: \"NodeAffinityPolicy indicates how","                                        we will treat Pod's nodeAffinity/nodeSelector","                                        when calculating pod topology spread skew.","                                        Options are: - Honor: only nodes matching","                                        nodeAffinity/nodeSelector are included in","                                        the calculations. - Ignore: nodeAffinity/nodeSelector","                                        are ignored. All nodes are included in the","                                        calculations. \\n If this value is nil, the","                                        behavior is equivalent to the Honor policy.","                                        This is a beta-level feature default enabled","                                        by the NodeInclusionPolicyInPodTopologySpread","                                        feature flag.\"","                                      type: string","                                    nodeTaintsPolicy:","                                      description: \"NodeTaintsPolicy indicates how","                                        we will treat node taints when calculating","                                        pod topology spread skew. Options are: - Honor:","                                        nodes without taints, along with tainted nodes","                                        for which the incoming pod has a toleration,","                                        are included. - Ignore: node taints are ignored.","                                        All nodes are included. \\n If this value is","                                        nil, the behavior is equivalent to the Ignore","                                        policy. This is a beta-level feature default","                                        enabled by the NodeInclusionPolicyInPodTopologySpread","                                        feature flag.\"","                                      type: string","                                    topologyKey:","                                      description: TopologyKey is the key of node","                                        labels. Nodes that have a label with this","                                        key and identical values are considered to","                                        be in the same topology. We consider each","                                        \u003ckey, value\u003e as a \"bucket\", and try to put","                                        balanced number of pods into each bucket.","                                        We define a domain as a particular instance","                                        of a topology. Also, we define an eligible","                                        domain as a domain whose nodes meet the requirements","                                        of nodeAffinityPolicy and nodeTaintsPolicy.","                                        e.g. If TopologyKey is \"kubernetes.io/hostname\",","                                        each Node is a domain of that topology. And,","                                        if TopologyKey is \"topology.kubernetes.io/zone\",","                                        each zone is a domain of that topology. It's","                                        a required field.","                                      type: string","                                    whenUnsatisfiable:","                                      description: 'WhenUnsatisfiable indicates how","                                        to deal with a pod if it doesn''t satisfy","                                        the spread constraint. - DoNotSchedule (default)","      